	(2, 1, 'Info Terkini', 'dashboard_text', 'Assalamualaikum & Salam Sejahtera kepada syarikat-syarikat \r\nyang telah mendapat pengesahan pendaftaran pada sistem \r\nRTM UKK TVCMS.\r\n\r\nUntuk makluman, pihak Urusetia mengambil kira cuti umum \r\nWesak dan kerja-Kerja kemaskini yang sedang dijalankan oleh \r\npihak teknikal sistem RTM UKK TVCMS bagi memastikan \r\nkelancaran proses penyerahan proposal secara muat naik \r\ndalam talian pada Sistem RTM UKK TVCMS dapat dilakukan, \r\nmaka tarikh baru penyerahan proposal akan bermula pada \r\nSelasa 17 Mei 2022 Hingga Ahad 22 Mei 2022.\r\n\r\n\r\nPihak syarikat yang telah mendapat pengesahan pendaftaran \r\nboleh  mengakses semula ke Sistem RTM UKK TVCMS mulai tarikh berkenaan. \r\n\r\nHarap Maklum.\r\n\r\nSekian, Terima Kasih.\r\nUrusetia, Unit Kandungan Kreatif (UKK),\r\nRadio Televisyen Malaysia (RTM)', '2022-06-21 21:04:11', '2022-06-21 21:49:17'),
	(3, 1, 'Panduan mendaftar', 'register_text', 'test 123', '2022-06-21 22:04:43', '2022-06-21 22:04:43');
